import React, {useState} from "react";
import { useFormik } from "formik";

export default function Signup() {
    const [Mname, setMname] = useState()
    

    return (
        <form>
            <div className="Mform_input">
                <input
                    id="Mname"
                    name="Mname"
                    type="text"
                    placeholder="Ваше имя"
                    onChange={(e) => setMname(e.target.value)}
                    value={Mname}
                />
            </div>
        </form>
    )
}
